import React from 'react';
import cover from "../images/cover-desktop.png"
function Cover() {
    return (
        <div className="cover-container">
            <img className="cover-image" src={cover} alt="Logo" />
            <div className="cover-content">
                <h1 className="cover-title">Explore the new BMW i4 range</h1>
                <p className="cover-text"> From the cool Trend and SUV-inspired Active
                    to the sporty ST-Line, the eighth generation Fiesta impresses across the range.</p>
            </div>
            <button className="btn-test-drive"></button>
        </div>
    )
}

export default Cover
